function myFunction(arr) {
  let out = "";
  let i;
  for (i = 0; i < arr.length; i++) {
    out += '<a href="' + arr[i].url + '"><img src="' + arr[i].image + '" alt="image" width="400px" height="250px"></a><br>';
    out += '<a href="' + arr[i].url + '" style="text-decoration: none;font-family:Arial;font-size: 20px;">' + arr[i].name + '</a><br>';
    out += '<a href="' + arr[i].url + '" style="text-decoration: none;font-family:Arial">' + arr[i].price + '</a><br>';
    out += '<a href="' + arr[i].url + '" style="text-decoration: none;font-family:Arial">' + arr[i].type + '</a><br><br>';

  }
   document.getElementById("demo").innerHTML = out;
}

